import React from "react";
import { Link } from 'react-router-dom';
import NgonserLogo from './img/ngonserlogo.png'


class navbar extends React.Component {
    render() {
        return (
            <Navbar bg="light" expand="lg">
                <Navbar.Brand href="#home">Logo Anda</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                        <Nav.Link as={Link} to="/">Tentang Kita</Nav.Link>
                        <Nav.Link as={Link} to="/hubungi">Hubungi Admin</Nav.Link>
                    </Nav>
                    <Form inline>
                        <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                        <Button variant="outline-success">Search</Button>
                    </Form>
                    <Nav className="ml-2">
                        <Nav.Link as={Link} to="/masuk">Masuk</Nav.Link>
                        <Nav.Link as={Link} to="/daftar">Daftar</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>
        );
    }
}

export default navbar;
